import "./App.css";
import Navbar from "./Component/navbar";
import FeedBack_user from "./Component/FeedBack_user";
import About from "./Component/about";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    //routers concept implimentation

    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navbar />}>
          <Route index element={<Home />} />
          <Route path="Feedback User" element={<FeedBack_user />} />
          <Route path="About" element={<About />} />
          <Route path="contact" element={<Contact />} />
          <Route path="*" element={<NoPage />} />
        </Route>
      </Routes>
    </BrowserRouter>

    //props concept implimentation
    // <>
    //   <Navbar title="Railway MCQ" quiz="MCQ Section" />
    //   <div className="container">
    //     <FeedBack_user heading="Dear user please Enter the Feedback!!!!!" />
    //   </div>
    //   <About />
    // </>
  );
}

export default App;
